package com.company.dao.pojo;

import java.io.Serializable;

public class Login implements Serializable{
	
	private static final long serialVersionUID = 1L;
	private Integer loginId;
	private String username;
	private String password;
	private Integer priority;
	public Login() {
		// TODO Auto-generated constructor stub
	}
	public Integer getLoginId() {
		return loginId;
	}
	public void setLoginId(Integer loginId) {
		this.loginId = loginId;
	}
	public String getUsername() {
		return username;
	}
	public void setUsername(String username) {
		this.username = username;
	}
	public String getPassword() {
		return password;
	}
	public void setPassword(String password) {
		this.password = password;
	}
	public Integer getPriority() {
		return priority;
	}
	public void setPriority(Integer priority) {
		this.priority = priority;
	}
	public Login(Integer loginId, String username, String password, Integer priority) {
		super();
		this.loginId = loginId;
		this.username = username;
		this.password = password;
		this.priority = priority;
	}
	@Override
	public String toString() {
		return "Login [loginId=" + loginId + ", username=" + username + ", password=" + password + ", priority="
				+ priority + "]";
	}
	public Login(String username, String password, Integer priority) {
		super();
		this.username = username;
		this.password = password;
		this.priority = priority;
	}
	public Login(String username, String password) {
		super();
		this.username = username;
		this.password = password;
		
	}
	
}
